const Form = () => {
  <form className="search-form">

  </form>
}

const Nav = () => {

  return(
      <nav className="main-nav">
          <ul>
              <li><a href='www.google.com'>Cats</a></li>
              <li><a href='www.google.com'>Dogs</a></li>
              <li><a href='www.google.com'>Computers</a></li>
          </ul>
      </nav>
  );
}

const PhotoContainer = (props) => {
  return (
      <div className="photo-container">
        <h2>Results</h2>
        <ul>
          {props.images.map( image =>
            <Photo 
              images={image.src}
              key={image.id}
              alt={image.alt}
            />
          )}
        </ul>
      </div>
  );
}

const Photo = (props) => {
  return (
    <li><img src={props.images} alt={props.alt}></img></li>
  );
}


const App = (props) => {
  return (
    <div>
      <Form />
      <Nav />
      <PhotoContainer images={props.images}/>

    </div>



  );
}

export default App;
